import Rotas from "./src/rotas";
import { TemaProvider } from "./src/contexts/TemaContext";
import { AutenticacaoContext } from "./src/contexts/AutenticacaoContext";

export default function App() {
  return (
    <TemaProvider>
      <AutenticacaoContext>
        <Rotas />
      </AutenticacaoContext>
    </TemaProvider>
  );
}
